componentsModule.modules.tags={start:function(){let current=componentsModule.modules.tags;current.parentElement=document.querySelector("[data-component=tags]");current.inputElement=current.parentElement.querySelector("input");current.listElement=current.parentElement.querySelector(".tags-list");current.templateElement=current.parentElement.querySelector("#template_component_tags_item").childNodes[0];componentsModule.initializeEvents([{event:"click",element:current.parentElement,content:function(a){if(a.target.matches(".tag-remove")){current.listElement.removeChild(a.target.parentNode);reloadPackery()}}},{event:"keyup",element:current.inputElement,content:function(a){if(!a.keyCode||a.keyCode!==13){return true}current.addTag()}}])},resume:function(){let current=componentsModule.modules.tags;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b).tags;if(a===null){return true}current.addTag(a.join(","))},addTag:function(b){let current=componentsModule.modules.tags;const a=b||current.inputElement.value.trim();if(!validateTags(a)){return true}const c=a.split(",");c.map(function(d){d=d.trim();const e=current.serialize().tags;if(~e.indexOf(d)){return true}let template=current.templateElement.cloneNode(true);template.innerHTML="#"+d+template.innerHTML;current.inputElement.value="";current.listElement.appendChild(template);reloadPackery()})},validate:function(){const a=componentsModule.modules.tags.serialize().tags;return validateTags(a)},serialize:function(){const a=componentsModule.modules.tags.listElement.childNodes;let tagList=Array.from(a).map(function(b){return b.innerText.trim().replace("#","")});return{tags:tagList}}};